import '../App.css';
import React from 'react';

function Categories(props) {
    return (
        <div>
            <section className="container flex-column">
                <div className="row">
                    <div className="col-12 col-lg-6 col-xl-6 col-md-6">
                        <img src="http://cdn.shopify.com/s/files/1/2277/5269/files/horizontal_banner_b2c06691-018b-4185-a7cd-9d5cb6f63b8e.jpg?v=1603366352" className="img-fluid pt-5   " alt="..."/>
                            <h2 className="text-center pt-3 c">{props.name}</h2>
                            <a href="#" className="a aaa">SHOP NOW</a>
                    </div>
                </div>
            </section>
        </div>
    );
}

export default Categories;
